INSERT INTO tbl_question VALUES("4","1","1","4.1.2 Does the medical laboratory services, including appropriate interpretation and advisory services meet :","531","531","2");
INSERT INTO tbl_question VALUES("5","1","1","-	the needs of patients and all personnel responsible for patient care?","531","531","3");
INSERT INTO tbl_question VALUES("6","1","1","4.1.3 Does the laboratory management system cover & meet the requirement of the standard for work carried out in:","531","531","2");
INSERT INTO tbl_question VALUES("7","1","1","-	permanent facilities? INSERT INTO tbl_question VALUES("8","1","1","4.1.4 If the laboratory is part of an organisation performing other than testing:","531","531","2");
INSERT INTO tbl_question VALUES("9","1","1","-	are responsibilities of key personnel defined in order to identify potential conflicts of interest?","531","531","3");
INSERT INTO tbl_question VALUES("10","1","1","4.1.5 Is the management responsible for the design, implementation, maintenance and improvement of the quality system with regards to the following:-","531","531","2");
INSERT INTO tbl_question VALUES("11","1","1","a) Management support to all personnel by providing the appropriate authority and resources to carry out their duties?","531","531","3");
INSERT INTO tbl_question VALUES("12","1","1","b) Have arrangements to ensure that its management and personnel are free from:INSERT INTO tbl_question VALUES("13","1","1","c) Policies and procedures to ensure confidentiality of information?","531","531","3");
INSERT INTO tbl_question VALUES("14","1","1","d) Have policies and procedures to avoid involvement in any activities that would diminish confidence in its competence, impartiality, judgment or operational integrity?","531","531","3");
INSERT INTO tbl_question VALUES("15","1","1","e) Define the organisation and management structure of the laboratory: INSERT INTO tbl_question VALUES("16","1","1","f) Specify the:INSERT INTO tbl_question VALUES("17","1","1","g) Provide adequate supervision of all testing staff by competent persons familiar withINSERT INTO tbl_question VALUES("18","1","1","h) Is technical management available?","531","531","3");
INSERT INTO tbl_question VALUES("19","1","1","i) Is a quality manager appointed?INSERT INTO tbl_question VALUES("20","1","1","j) Appoint deputies for key managerial personnel? (In smaller laboratories, staff may have more than one function and it may be impractical to appoint deputies for every function.)","531","531","3");
INSERT INTO tbl_question VALUES("21","1","2","4.2.1 Are policies and procedures including the requirements of the methods to be used:","531","531","2");
INSERT INTO tbl_question VALUES("22","1","2","-	defined? INSERT INTO tbl_question VALUES("23","1","2","4.2.2 Does the quality system include, but not limited to","531","531","2");
INSERT INTO tbl_question VALUES("24","1","2","-	internal quality control? INSERT INTO tbl_question VALUES("25","1","2","4.2.3 Is quality policy statement","531","531","2");
INSERT INTO tbl_question VALUES("26","1","2","-	defined under the authority of laboratory director? INSERT INTO tbl_question VALUES("27","1","2","a) the scope of service the laboratory intends to provide?","531","531","3");
INSERT INTO tbl_question VALUES("28","1","2","b) the managements statement of the laboratorys standard of service?","531","531","3");
INSERT INTO tbl_question VALUES("29","1","2","c) objectives of the quality system?","531","531","3");
INSERT INTO tbl_question VALUES("30","1","2","d) a requirement that all staff within the laboratory familiarize themselves with the quality documentation and implement the policies and procedures in their work?","531","531","3");
INSERT INTO tbl_question VALUES("31","1","2","e) the laboratorys commitment to good professional practice, the quality of its examinations, and compliance with the quality management system?","531","531","3");
INSERT INTO tbl_question VALUES("32","1","2","f) laboratory managements commitment to compliance with ISO 15189?","531","531","3");
