INSERT INTO tbl_question VALUES("35","1","2","Are personnel instructed on the use and application of the quality manual references, supporting procedures including technical procedures?","531","531","1");
INSERT INTO tbl_question VALUES("36","1","2","Is the quality manual maintained current under the authority and responsibility of the quality manager?","531","531","1");
