INSERT INTO tbl_question VALUES("44","1","3","-	retention period defined?","531","531","3");
INSERT INTO tbl_question VALUES("45","1","3","(Document refers to any information including policy statements, text books, procedures, specifications, calibration tables, biological reference intervals and their origins, charts, posters, notices, memoranda,software, drawings, plans, documents of exte","531","531","1");
INSERT INTO tbl_question VALUES("46","1","3","4.3.2 Are procedures adopted to ensure that:","531","531","2");
INSERT INTO tbl_question VALUES("47","1","3","a) documents issued to personnel reviewed and approved for use prior to issue?","531","531","3");
INSERT INTO tbl_question VALUES("48","1","3","b) a master list or an equivalent document control procedure available to identify the current revision status and distribution of documents?","531","531","3");
