INSERT INTO tbl_question VALUES("1447","3","23","-	monitored? INSERT INTO tbl_question VALUES("1448","3","23","5.8.12 When examination results from referral laboratory need to be transcribed by the referring laboratory, are there procedures available to verify the correctness of all transcriptions?","531","531","1");
