INSERT INTO tbl_question VALUES("1450","3","23","Do the procedures also include guidelines for the release of results directly to patients?","531","531","1");
INSERT INTO tbl_question VALUES("1451","3","23","5.8.14 Does the laboratory establish policies and practices to ensure that the results distributed by telephone or other electronic means only reach authorised receivers?","531","531","1");
INSERT INTO tbl_question VALUES("1452","3","23","Are results provided verbally followed by a properly recorded report?","531","531","1");
INSERT INTO tbl_question VALUES("1453","3","23","5.8.15 Does the laboratory have written policies and procedures regarding the alteration of reports?","531","531","1");
INSERT INTO tbl_question VALUES("1454","3","23","Does altered reports indicate the","531","531","2");
INSERT INTO tbl_question VALUES("1455","3","23","	time?INSERT INTO tbl_question VALUES("1456","3","23","Are original entries legible when alterations are made?","531","531","1");
INSERT INTO tbl_question VALUES("1457","3","23","Are original electronic records retained and alterations added to the record through appropriate editing procedures so that reports clearly indicate the alteration?","531","531","1");
INSERT INTO tbl_question VALUES("1458","3","23","5.8.16 Are results used for clinical decision-making revised and retained in subsequent cumulative reports and clearly identified as having been revised?","531","531","1");
INSERT INTO tbl_question VALUES("1459","3","23","If the reporting system cannot capture amendments, changes, or alterations, is an audit log used?","531","531","1");
INSERT INTO tbl_question VALUES("1460","3","24","A. Key Personnel","531","531","2");
INSERT INTO tbl_question VALUES("1461","3","24","1. Do the key personnel still occupy appropriate positions in the staff structure to be responsible for the adequacy of test results?","531","531","3");
INSERT INTO tbl_question VALUES("1462","3","24","2. Do the key personnel still retain sufficient contact time with testing procedures to maintain the ability for critical evaluation of results?","531","531","3");
INSERT INTO tbl_question VALUES("1463","3","24","3. For key personnel, are the requirements stated in Clause 7 of SAC-SINGLAS 001- MED being met?","531","531","3");
INSERT INTO tbl_question VALUES("1464","3","24","B. SAC-SINGLAS Endorsed Reports and Use of Mark","531","531","2");
INSERT INTO tbl_question VALUES("1465","3","24","1. Does the laboratory comply with the terms and conditions for SAC-SINGLAS endorsed report as stipulated in SAC-SINGLAS 001- MED, Clause 10?","531","531","3");
INSERT INTO tbl_question VALUES("1466","3","24","C. Obligations of the accredited laboratoryINSERT INTO tbl_question VALUES("1467","3","24","Any change in its legal, commercial or organisational status;","531","531","3");
INSERT INTO tbl_question VALUES("1468","3","24","Any change in policies and procedures, where appropriate;","531","531","3");
INSERT INTO tbl_question VALUES("1469","3","24","Any change in organisation and management eg. key personnel, authorised representative;","531","531","3");
INSERT INTO tbl_question VALUES("1470","3","24","Changes of duties of key personnel;","531","531","3");
INSERT INTO tbl_question VALUES("1471","3","24","Significant changes in laboratory environment, equipment, facilities and/or other resource;","531","531","3");
INSERT INTO tbl_question VALUES("1472","3","24","Change of premises, where the laboratory will be subjected to a re-assessment which will cover the full scope of accreditation and the laboratory has the responsibility to inform SAC-SINGLAS at least 3 months in advance;","531","531","3");
