

CREATE TABLE `tbl_category` (
  `catid` int(11) NOT NULL AUTO_INCREMENT,
  `catname` varchar(255) NOT NULL,
  `cattimestamp` timestamp NULL DEFAULT '0000-00-00 00:00:00',
  `uid` int(11) NOT NULL,
  `superadminid` int(11) NOT NULL,
  PRIMARY KEY (`catid`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8;






CREATE TABLE `tbl_location` (
  `locid` int(11) NOT NULL AUTO_INCREMENT,
  `locname` varchar(255) NOT NULL,
  `loctimestamp` timestamp NULL DEFAULT '0000-00-00 00:00:00',
  `uid` int(11) NOT NULL,
  `superadminid` int(11) NOT NULL,
  PRIMARY KEY (`locid`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8;






CREATE TABLE `tbl_option` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `option` varchar(255) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8;






CREATE TABLE `tbl_project` (
  `pid` int(11) NOT NULL AUTO_INCREMENT,
  `qid` int(11) NOT NULL,
  `pdate` date NOT NULL,
  `notes` text NOT NULL,
  `auditedby` varchar(255) NOT NULL,
  `t_name` varchar(50) NOT NULL,
  `tempid` int(11) NOT NULL,
  `l_name` varchar(50) NOT NULL,
  `locid` int(11) NOT NULL,
  `auditor_c_name` varchar(200) NOT NULL,
  `auditor_c_logo` varchar(255) NOT NULL,
  `client_c_name` varchar(200) NOT NULL,
  `client_c_logo` varchar(255) NOT NULL,
  `t_type` varchar(20) NOT NULL,
  `status` tinyint(4) NOT NULL,
  `status_prograse` tinyint(4) NOT NULL,
  `categoryid` int(11) NOT NULL,
  `pre_audit_id` varchar(255) NOT NULL,
  `audit_type` int(11) NOT NULL,
  `option` int(11) NOT NULL,
  `uid` int(11) NOT NULL,
  `superadminid` int(11) NOT NULL,
  `timestamp` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`pid`)
) ENGINE=InnoDB AUTO_INCREMENT=76 DEFAULT CHARSET=utf8;






CREATE TABLE `tbl_project_qreview` (
  `prid` int(11) NOT NULL AUTO_INCREMENT,
  `pid` int(11) NOT NULL,
  `qid` int(11) NOT NULL,
  `que_id` int(11) NOT NULL,
  `sid` int(11) NOT NULL,
  `answer` int(11) NOT NULL,
  `comment` text NOT NULL,
  `attachment` varchar(255) NOT NULL,
  `option` varchar(255) NOT NULL,
  `timestamp` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`prid`)
) ENGINE=InnoDB AUTO_INCREMENT=27666 DEFAULT CHARSET=utf8;






CREATE TABLE `tbl_project_sreview` (
  `srid` int(11) NOT NULL,
  `pid` int(11) NOT NULL,
  `qid` int(11) NOT NULL,
  `sid` int(11) NOT NULL,
  `cat_name` varchar(255) NOT NULL,
  `comment` text NOT NULL,
  `attachment` varchar(255) NOT NULL,
  `option` varchar(255) NOT NULL,
  `timestamp` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP
) ENGINE=InnoDB DEFAULT CHARSET=utf8;






