CREATE TABLE `tbl_questionnair` (
  `qid` int(11) NOT NULL AUTO_INCREMENT,
  `title` varchar(255) DEFAULT NULL,
  `uid` int(11) DEFAULT '0',
  `superadminid` int(11) DEFAULT '0',
  `copyfrom` int(11) DEFAULT '0',
  `modified_date` timestamp NOT NULL DEFAULT '1970-01-05 00:00:00',
  `timestamp` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `audittype` int(11) DEFAULT '0',
  PRIMARY KEY (`qid`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8;






CREATE TABLE `tbl_section` (
  `sid` int(11) NOT NULL,
  `qid` int(11) NOT NULL,
  `s_no` varchar(50) NOT NULL,
  `s_title` varchar(255) NOT NULL,
  `catid` int(11) NOT NULL,
  `audit_type` int(11) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8;






CREATE TABLE `tbl_settings` (
  `sid` int(11) NOT NULL AUTO_INCREMENT,
  `key` varchar(255) NOT NULL,
  `value` varchar(255) NOT NULL,
  `superadminid` int(11) NOT NULL,
  `uid` int(11) NOT NULL,
  PRIMARY KEY (`sid`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8;






CREATE TABLE `tbl_templates` (
  `tempid` int(11) NOT NULL AUTO_INCREMENT,
  `tempname` varchar(255) DEFAULT NULL,
  `auditorcname` varchar(255) DEFAULT NULL,
  `auditorclogo` varchar(255) DEFAULT NULL,
  `clientcname` varchar(255) DEFAULT NULL,
  `clientclogo` varchar(255) DEFAULT NULL,
  `temptype` varchar(255) DEFAULT NULL,
  `modified_date` timestamp NOT NULL DEFAULT '1970-01-05 00:00:00',
  `temptimestamp` timestamp NULL DEFAULT '0000-00-00 00:00:00',
  `uid` int(11) DEFAULT '0',
  `superadminid` int(11) DEFAULT '0',
  PRIMARY KEY (`tempid`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8;




